import React from 'react';
import Playlist from './Playlist'

const PlaylistsList = ({ url, playlists, deletePlaylist }) => {

    return (
        <ul>
            {playlists.map( playlist => 
                <Playlist key={playlist.id} url={url} playlist={playlist} deletePlaylist={deletePlaylist} />
            )}
        </ul>
    )
}

export default PlaylistsList;
